import React from 'react';
import { Link } from 'react-router-dom';
const ActionDashboard = () => {
    return (
        <div>
             <Button primary><Link to="/edit-profile" className="ui ">Edit Profie</Link></Button>
             <Button primary><Link to="/add-experience" className="ui ">Add Experience</Link></Button>
             <Button primary><Link to="/add-education" className="ui ">Add Education</Link></Button>
            
        </div>
    )
}

export default ActionDashboard;
